import React from 'react';
import { Routes, Route } from "react-router-dom";
import Productos from './componentes/Productos.jsx';
import Testimonio from './componentes/Testimonios.jsx';
import Inicio from "./componentes/Inicio.jsx";
import Navegacion from "./componentes/Navegacion.jsx";
import CapturarDatos from './componentes/IngresoDatos.jsx';

function App() {
  return (
    <div className="App">
          <Navegacion/>
          <Inicio/>
      <Routes>
        <Route path="inicio" element={ <Inicio /> } />
        <Route path="sobre-productos" element={ <Productos /> } />
        <Route path="sobre-testimonios" element={ <Testimonio/> } />
        <Route path="capturar-datos" element={ <CapturarDatos/> } />
      </Routes>

    </div>
  );
}

export default App;
